// src/components/EditorsList.js
import React from 'react';
import '../../CSS/EditorsList.css'; // Import your CSS file

const EditorsList = ({ editors, onBack }) => (
  <div className="editors-list">
    <h2>Editors List</h2>
    {editors.length === 0 ? (
      <p>No editors found.</p>
    ) : (
      <table className="table">
        <thead>
          <tr>
            <th>ID</th>
            <th>First Name</th>
            <th>Last Name</th>
          </tr>
        </thead>
        <tbody>
          {editors.map((editor) => (
            <tr key={editor.id}>
              <td>{editor.id}</td>
              <td>{editor.firstName}</td>
              <td>{editor.lastName}</td>
            </tr>
          ))}
        </tbody>
      </table>
    )}
    <button onClick={onBack}>Back to Admin Options</button>
  </div>
);

export default EditorsList;
